measurements.description:
Forty-seven pristine flowers and nine buds on 30 up to 12-cm inflorescences;
	immaculate well grown 27-cm x 25-cm plant mounted on 9-cm x 15-cm cork slab;

	 dorsal sepal white, cauda light gold, pronounced raised mid-rib;
	 lateral sepals and caudae light gold;
	 petals and caudae light gold fading to light green centrally;
	lip white, nectary 9.3-cm, pale green, pale gold distally;
	substance firm; texture satin; also received award 20235368.
